const icon = `data:image/png;base64,`;

const css = `
	.pink {
		position: fixed;
		top: 0;
		left: 0;
		right: 0;
		bottom: 0;
		background: rgba(255, 0, 235, 0.7) url(${icon}) center no-repeat;
		z-index: 100500;
	}
`;


const main = (head) => {
	if(location.href.indexOf('/pull/') === -1) { return; }

	const total = Array.from(document.querySelectorAll('.diffstat .text-red, .diffstat .text-green'))
			.map(el => el.innerText)
			.map(str => str.trim().replace(/^(|\+)/, ''))
			.map(str => Number(str))
			.reduce((a, b) => a + b, 0);
	if(total < 1000) { return; }

  const style = document.createElement('style');
  style.appendChild( document.createTextNode(css) );
  head.appendChild(style);

  const pinkExt = document.createElement('div');
  pinkExt.className ='pink';
  document.body.appendChild(pinkExt);
};

export default {
  name: 'Pink Hate',
  version: '0.0.1',
  icon,
  description: 'Not pink dildo',
  main
};